// card Component
import React from "react";
import "../App.css";

const Card = ({ title, content }) => {

    const Show = () => {
        return title !== "Dummy";
    };

    return ( 
        <div class="card border_all">
            <div className="card-heading">
                <h5 class="card-title">{title}</h5>
            </div>
            <div class="card-body">
                <p class="card-text">{content}</p>
            </div>
        </div>
    );
};

export default Card;
